import { Grid } from "@mui/material";
import React, { useState } from "react";
import { Form } from "react-router-dom";
import "./login.css"


const Login = () => {
    const [user, setUser] = useState({
        email: "",
        password: ""
    })

    const handlechange = e => {

        const { name, value } = e.target
        setUser({
            ...user,
            [name]: value

        })


    }



    const login = () => {

        e.preventDefault();

    }

    return (
        <div className="popup-body">

            <form>
                <h1>
                    Sign in to Twitter
                </h1>
                <Grid container>
                    <div>

                        <h3 >
                            Email ID
                        </h3>
                        <Grid item>
                            <input type="text" className="input-style" name="email" onChange={handlechange}>
                            </input>

                        </Grid>


                        <h3 >
                            Password
                        </h3>

                        <Grid item>
                            <input type="password" className="input-style" name="password" onChange={handlechange}>
                            </input>

                        </Grid>

                        <div>

                            <div className="landing-page-signup-button" style={{ marginTop: "3em" }}>
                                <span onSubmit={login} className="landing-page-signup-button-text">
                                    Sign In.</span>
                            </div>

                        </div>
                    </div>

                </Grid>
            </form>
        </div>
    )
}
export default Login;
